errors = []

lines = data_45.strip().split('\n')

for line in lines:
    parts = line.split(',')
    euler_angle = float(parts[0].split(': ')[1].split(' ')[0])
    angular_velocity = float(parts[1].split(': ')[1])
    angular_acceleration = float(parts[2].split(': ')[1])
    error = float(parts[3].split(': ')[1])
    
    euler_angles.append(euler_angle)
    angular_velocities.append(angular_velocity)
    angular_accelerations.append(angular_acceleration)
    errors.append(error)


print("Euler angles:", euler_angles)
#print("Angular velocities:", angular_velocities)
#print("Angular accelerations:", angular_accelerations)
#print("Errors:", errors)


import matplotlib.pyplot as plt

def plot_data_over_time(euler_angles, angular_velocities, angular_accelerations, errors): 
    time_steps = [i * 0.1 for i in range(len(euler_angles))]  # Assuming each data point is at a time step of 0.1 seconds

    plt.figure(figsize=(25, 10))

    # Add big title
    plt.suptitle('Simple Sliding Mode Controller with Target Angle 45 Degrees', fontsize=16)


    # Plot Euler angles over time
    plt.subplot(2, 2, 1)
    plt.plot(time_steps, euler_angles, linestyle='-')
    plt.axhline(y=45, color='r', linestyle='--')  # Horizontal line at 45 degrees
    plt.title('Current Angle of ISAAC')
    plt.xlabel('Time (Seconds)')
    plt.ylabel('Current Angle (Degrees)')

    # Plot angular velocities over time
    plt.subplot(2, 2, 2)
    plt.plot(time_steps, angular_velocities, linestyle='-')
    plt.axhline(y=0, color='r', linestyle='--')  # Horizontal line at 0
    plt.title('Angular Velocity over Time')
    plt.xlabel('Time (Seconds)')
    plt.ylabel('Angular Velocity (Deg/s)')

    # Plot angular accelerations over time
    plt.subplot(2, 2, 3)
    plt.plot(time_steps, angular_accelerations, linestyle='-')
    plt.axhline(y=0, color='r', linestyle='--')  # Horizontal line at 0
    plt.title('Angular Acceleration over Time')
    plt.xlabel('Time (Seconds)')
    plt.ylabel('Angular Acceleration (Deg/s^2)')

    # Plot errors over time
    plt.subplot(2, 2, 4)
    plt.plot(time_steps, errors, linestyle='-')
    plt.axhline(y=0, color='r', linestyle='--')  # Horizontal line at 0
    plt.title('Error Angle over Time')
    plt.xlabel('Time (Seconds)')
    plt.ylabel('Error (Degrees)')

    plt.tight_layout()
    plt.show()


plot_data_over_time(euler_angles, angular_velocities, angular_accelerations, errors)
